const Workshop = ({ registration }) => {
    if(registration)
        return (
            <form>
                <input>Nombre</input>
                <input>Datos de contacto</input>
            </form>
        );
    else
        return(
            <form>
                <input>Nombre</input>
            </form>
        );
}
